import { useSelector } from 'react-redux';
import './styles/Cards.css';

export default function Cards(){
    const pokemons = useSelector((state) => state.pokemons)

    return(
        <div className='cards'>
            {pokemons.map(p => {
                return <div className='card'>
                    <span>{p.name}</span>
                    <img src={p.image}/>
                    <ul>
                        {p.types.map(t => <ls>t.type.name</ls>)}
                    </ul>
                </div>
            })}
        </div>
    )
}
